import './App.css';

import { Route, Switch } from "react-router-dom"

import Homepage from './components/Homepage';
import Nav from './components/Nav';





export default function App() {
  return (
    <Router>
          <Routes>
            <Route  path="/" component={Nav} />
            <Route  path="/" component={Homepage} />

          </Routes>
      </Router>
  )
}
